import React from "react";
import { Routes, Route, BrowserRouter } from "react-router-dom";
import "./App.css";
import HomeContainer from "./containers/HomeContainer";

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" component={<HomeContainer />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
